INSERT INTO `service_entry` VALUES (3,0,3,'2D_Map','This service generates a map of a 2-dimensional variable with time averaging and spatial subsetting.  Select a data source (model or observation), a variable name, a time range, and a spatial range (lat-lon box) below.','1','2016-05-12 14:31:34.000000','2016-10-27 14:35:58.000000','/assets/images/2DMap.png',4.4,7,'1'),(4,0,3,'Empirical-Orthogonal-Function-(EOF)-Analysis','EOF analysis is a principal component analysis (PCA) applied to a set of spatially related time series, with each time series being geographically weighted. PCA is a statistical procedure.','1',NULL,NULL,'/assets/images/EOF.png',3,1,'1'),(8,0,3,'3-D-Variable-2-D-Slice','This service generates a slice map of a 3-dimensional variable at a selected pressure level.  Select a data source, a variable name, a time range, a spatial range, and a pressure level below.','1','2016-05-23 18:14:40.000000','2016-10-13 12:17:31.000000','/assets/images/image_b816e2eb-eb33-46c5-bf67-2c67d1c98e3f.jpeg',0,0,'1'),(9,0,3,'Scatter-and-Histogram-Plot-of-Two-Variables','This service generates a scatter plot between two specified variables and the histograms of the two variables, and calculates the correlation of the two variables. ','1','2016-05-23 18:17:52.000000','2016-10-13 16:18:41.000000','/assets/images/image_bdc7bad1-6f89-4362-ae5f-a24ddf3e914b.png',0,0,'1'),(10,0,3,'Difference-Plot-of-Two-Time-Averaged-Variables','This service calculates the differences between two specified variables and displays the lat-lon maps of the two variables and their differences.','1','2016-05-23 18:19:13.000000','2016-10-18 10:39:06.000000','/assets/images/image_69146b04-f2b0-4ca6-8a0c-f12206e65fb6.png',0,0,'1'),(11,0,3,'Time-Lagged-Correlation-Map-of-Two-Variables','This service generates a time-lagged correlation map between two specified variables.  The two variables can be either a two-dimensional variable or a slice of a three-dimensional variable at a specific pressure level.','1','2016-05-23 18:22:11.000000','2016-10-31 10:42:47.000000','/assets/images/image_5f4b66b6-4314-43a4-996f-e41466a3557e.png',0,0,'1'),(12,0,3,'Random-Forest-Importance','This service computes a random forest model between a target variable and a set of source variables, and then ranks the source variables in terms of their importances in predicting the target variable','1','2016-05-23 18:35:55.000000','2016-10-13 16:20:03.000000','/assets/images/image_76ff603e-c4c8-4069-802c-3c56ae05e5e2.png',0,0,'1'),(14,0,3,'Conditional-Probability-Density-Function','Conditional Probability Density Function ','1','2016-05-23 18:40:49.000000','2016-10-13 14:16:15.000000','/assets/images/image_df28907f-5f09-4f31-b955-3d520768a4ce.png',0,0,'1'),(15,0,3,'Anomaly-Calculation','This service calculates the anomaly of a variable by removing a reference which can be either the seasonal cycle or the the mean. The reference can be calculated from the same variable or from another variable.','1','2016-06-01 10:32:57.000000','2016-10-31 15:05:35.000000','/assets/images/service.jpeg',5,2,'1'),(16,0,3,'Time-Series','Time Series service allows a user to plot one or more variables as function(s) of time. ','1','2016-06-01 15:11:40.000000','2016-10-17 14:45:00.000000','/assets/images/image_2834d943-1a6d-4d1e-8beb-fe37c24990aa.jpeg',0,0,'1'),(17,0,29,'2-D-Variable-Zonal-Mean','This service generates a graph of a 2-dimensional variable\'s zonal mean with time averaing.  Select a data source (model or observation), a variable name, and a time range below.','1','2016-08-11 23:11:33.000000','2016-10-13 16:18:02.000000','/assets/images/image_de4da539-f8d5-454e-8e23-424263f7483c.png',4,1,'1'),(18,0,29,'3-D-Variable-Zonal-Mean','This service generates a contour plot of zonal-mean vertical profiles of a 3-dimensional variable.  Select a data source, a variable name, a time range, and a pressure range below.','1','2016-08-11 23:17:01.000000','2016-10-18 10:29:49.000000','/assets/images/image_a8f3af06-e151-45cc-927b-5ca979ec0fbe.png',0,0,'1'),(19,0,29,'3-D-Variable-Average-Vertical-Profile','This service generates the average of a three-dimensional variable over a specified region and time and display the average as a function of pressure level as an X-Y plot.','1','2016-08-11 23:28:33.000000','2016-10-18 10:30:04.000000','/assets/images/image_22c7813a-bff3-4a1c-919a-fe34bda222f8.png',0,0,'1'),(20,0,3,'Map-View','Map View service allows a user to display one or more variables as function(s) of latitude and longitude as a map or values are computed ','1','2016-08-13 16:25:14.000000','2016-10-20 09:00:47.000000','/assets/images/image_dba28359-7e2f-40b6-ab71-990a8bd2529a.jpeg',0,0,'1'),(21,0,29,'Conditional-Sampling-with-Two-Variables','This service sorts one variable called sampled variable by the values of two variables called sampling variables and displays the averaged value.','1','2016-08-14 17:50:06.000000','2016-10-13 14:14:32.000000','/assets/images/image_cb09ed18-f037-468d-85ff-a020599de187.png',0,0,'1'),(22,0,29,'Regrid-and-Download','This service regrids a variable from a dataset according to the lat/lon/plev specified by the user, and mades the regridded data downloadable by the user.','1','2016-08-14 17:56:07.000000','2016-10-18 10:44:44.000000','/assets/images/service.jpeg',0,0,'1'),(23,0,29,'Conditional-Sampling-with-One-Variable','This service sorts one variable by the values of another variable (environmental condition, e.g. SST) and displays the averaged value of the first variable as a function of the bin value of the second variable.','1','2016-08-15 06:32:56.000000','2016-10-13 16:18:21.000000','/assets/images/image_2de3eab9-3d73-41b9-825e-5d32fee989d1.png',0,0,'1'),(24,0,29,'Time-Series-for-Work-Flow','Time Series service allows a user to plot one or more variables as function(s) of time. At each time point, the values are computed by averaging physical variables over a longitude and latitude box.  ','1','2016-08-15 16:14:28.000000','2016-10-31 15:05:43.000000','/assets/images/image_1ffbfa18-a40d-4c3b-a9a5-11b2d4856fa1.png',0,0,'1');
